import './App.css';
import React from 'react';


const App = () => {
	return (
		<div className='site'>
			<header>
				<img src="https://www.freelogodesign.org/Content/img/logo-ex-7.png" alt=""/>
			</header>
			<nav>
				<ul>
					<li>Profile</li>
					<li>Messages</li>
					<li>News</li>
					<li>Music</li>
				</ul>
			</nav>
			<main></main>
			<footer></footer>
		</div>
	)
}


export default App;
